||| 自転車と一緒にカートへ入れてください |||<br><br><br>


「ネットで自転車を買うと、<br>
　自分で組立するのが、ちょっと不安…」<br><br>

ちょっとまってください！！<br>
TOKYO DEPOTならそんなお客様の声にお応えします！<br><br>

【組立オプション】を自転車と一緒に購入すればプロの自転車整備士が<br>
すぐ乗れる状態に組立・整備して、自転車をお届けします！<br><br>

安心安全、組立作業のわずらわしさもなくオススメです！<br><br>


※一部のパーツ・アクセサリーは同梱となる場合がございます。<br>
　予めご了承ください。<br><br>
※商品発送の際はハンドル・サドルはめいっぱい低い状態、<br>
　ブレーキレバーは幅を縮めずにブレーキを若干緩めた状態でお送りします。<br>
※点検・組立・調整済みで出荷しますが、運送時の振動などにより<br>
　調整に狂いが生じる場合があります。<br>
　ブレーキ・変速機については購入後に再調整をお願いします。<br>
※自転車本体の送料は変更いたしません。<br><div align="center">

<img src="http://image.rakuten.co.jp/fodbicycle/cabinet/01932173/parts_dokon-r.jpg">
<table width="680" border="0" cellpadding="0" cellspacing="0" >
  <tr>
<td valign="top" height="20"><font size="-1" color="#FF0000">※</font></td>
<td valign="top"><font size="-1" color="#FF0000"><strong>チャイルドシートなど、同梱できない大きさの商品もございます。注文時にご確認ください。</strong></font></td>
</tr>
<tr>
<td valign="top" height="20"><font size="-1">※</font></td>
<td valign="top"><font size="-1">製造時期、品質向上などにより、製品仕様は予告無く変更されることがあります。</font></td>
</tr>
<tr>
<td valign="top" height="20"><font size="-1">※</font></td>
<td valign="top"><font size="-1">掲載画像は、できる限り現品と同じになる様努めておりますが、ご使用の環境により色合いが異なる場合がございます。</font></td>
</tr>
<tr>
<td valign="top" height="20"><font size="-1">※</font></td>
<td valign="top"><font size="-1">商品はお取り寄せになる場合もございます。その場合、ご注文時にお知らせいたします。</font></td>
</tr>
<tr>
<td valign="top" height="20"><font size="-1">※</font></td>
<td valign="top"><font size="-1">お取り寄せには一週間前後かかりますので、あらかじめご了承ください。<br>
お取り寄せ先にて品切れ、又は入荷までにお時間がかかる場合は、私どもより追ってご連絡申し上げます。</font></td>
</tr>
</table>
</div>



