html {
overflow-x: hidden;
}

/*買い物かごに入れるボタン*/
#rakutenLimitedId_aroundCart input[value="買い物かごに入れる"]{
background: url("http://image.rakuten.co.jp/fodbicycle/cabinet/01932173/intocart.gif") left top no-repeat;
width:210px;
height:50px;
text-indent:100%;
white-space:nowrap;
overflow:hidden;
border: none;
padding:0;
margin-top:5px 0;
cursor:pointer;
}
#rakutenLimitedId_aroundCart tbody tr td input:hover{
alpha(opacity=8);
-moz-opacity:0.8;
opacity:0.8;
cursor:pointer;
}
</style>

